import React from 'react';
import './App.css';

const Navigation = () => {
  return (
    <nav className="navbar">
      <ul>
        <li><a href="#home">Home</a></li>
        <li><a href="#about">About</a></li>
        <li><a href="#services">Services</a></li>
        <li><a href="#gallery">Gallery</a></li>
        <li><a href="#contact">Contact</a></li>
      </ul>
    </nav>
  );
};

const Header = () => {
  return (
    <header className="header">
      <h1>Eco Leaf Plantation</h1>
      <p>Your partner in sustainable farming</p>
    </header>
  );
};

const AboutUs = () => {
  return (
    <section className="about" id="about">
      <h2>About Us</h2>
      <p>We are committed to promoting eco-friendly and sustainable farming practices.</p>
    </section>
  );
};

const Services = () => {
  return (
    <section className="services" id="services">
      <h2>Our Services</h2>
      <ul>
        <li>Organic Farming</li>
        <li>Permaculture Design</li>
        <li>Soil Conservation</li>
        <li>Water Management</li>
      </ul>
    </section>
  );
};

const Gallery = () => {
  return (
    <section className="gallery" id="gallery">
      <h2>Gallery</h2>
      {/* Gallery images */}
    </section>
  );
};

const Contact = () => {
  return (
    <section className="contact" id="contact">
      <h2>Contact Us</h2>
      <form>
        {/* Contact form */}
      </form>
    </section>
  );
};

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2024 Eco Leaf Plantation</p>
    </footer>
  );
};

const App = () => {
  return (
    <div className="App">
      <Navigation />
      <Header />
      <main>
        <AboutUs />
        <Services />
        <Gallery />
        <Contact />
      </main>
      <Footer />
    </div>
  );
};

export default App;
